#!/usr/bin/env python3

import base64
import pickle
import re
import sys


# Solutions computed using brute force for the left half of the board
encoded_solns = """"""

# Load solutions
solns = pickle.loads(base64.b64decode(encoded_solns))

# Read lines from stdin
lines = [line.strip() for line in sys.stdin.readlines()]

# Parse scenarios
scenarios = [[int(i) for i in re.split(r'\D', line)] for line in lines[1:]]

# Solve each scenario
for scenario in scenarios:
    # Get the king positions
    y1, x1, y2, x2 = scenario

    # The solutions available are for the top half of the board, if y1
    # is on the right of the board, we need to get our answer using
    # symmetry
    reflect = lambda i, j: (7 - i, 7 - j)

    MIRROR = True if y1 > 3 else False

    # Get the effective position of the kings
    king1 = (y1, x1)
    king2 = (y2, x2)

    if MIRROR:
        king1 = reflect(*king1)
        king2 = reflect(*king2)

    # Get the solution. Need to be a touch careful here based on how the
    # solutions are stored (only one per unique pair).
    if (king1[0] > king2[0]
       or king1[0] == king2[0] and king1[1] > king2[1]):
        soln = solns[king2, king1]
    else:
        soln = solns[king1, king2]

    # Print the solution
    print(len(soln))

    for queen in soln:
        # Reflect back if needed
        if MIRROR:
            queen = reflect(*queen)

        print("Q %d %d" % (queen[0], queen[1]))
